        for char in text:
            if char in grammar.S:
                stack.append(char)
            elif char in grammar.NT2:
                stack.append(grammar.NT2)
            elif char in grammar.NT3:
                stack.append(grammar.NT3)
            elif char in grammar.NT4:
                stack.append(grammar.NT4)
            elif char == ' ':
                continue
            else:
                return False
